def HMAC_hash(secret, seed):
    ret = HMAC.new(secret, seed, SHA384).digest()
    #print('Hashing secret, seed: {}, {}'.format(secret, seed))
    #print('Generated key material: [{}]{}'.format(len(ret), ret))
    return ret


def P_hash(secret, seed):
    A_0 = seed
    A_1 = HMAC_hash(secret, A_0)
    A_2 = HMAC_hash(secret, A_1)
    A_3 = HMAC_hash(secret, A_2)
    A_4 = HMAC_hash(secret, A_3)
    A_5 = HMAC_hash(secret, A_4)
    A_6 = HMAC_hash(secret, A_5)
    A_7 = HMAC_hash(secret, A_6)
    A_8 = HMAC_hash(secret, A_7)
    A_9 = HMAC_hash(secret, A_8)
    A_10 = HMAC_hash(secret, A_9)

    return HMAC_hash(secret, A_1 + seed)\
           + HMAC_hash(secret, A_2 + seed)\
           + HMAC_hash(secret, A_3 + seed)\
           + HMAC_hash(secret, A_4 + seed)\
           + HMAC_hash(secret, A_5 + seed)\
           + HMAC_hash(secret, A_6 + seed)\
           + HMAC_hash(secret, A_7 + seed)\
           + HMAC_hash(secret, A_8 + seed)\
           + HMAC_hash(secret, A_9 + seed)\
           + HMAC_hash(secret, A_10 + seed)


def PRF(secret, label, seed):
    return P_hash(secret, label + seed)

